class NewsPageListResponseEntity {
  NewsPageListResponseEntity({
      int? counts, 
      int? pagesize, 
      int? pages, 
      int? page, 
      List<Items>? items,}){
    _counts = counts;
    _pagesize = pagesize;
    _pages = pages;
    _page = page;
    _items = items;
}

  NewsPageListResponseEntity.fromJson(dynamic json) {
    _counts = json['counts'];
    _pagesize = json['pagesize'];
    _pages = json['pages'];
    _page = json['page'];
    if (json['items'] != null) {
      _items = [];
      json['items'].forEach((v) {
        _items?.add(Items.fromJson(v));
      });
    }
  }
  int? _counts;
  int? _pagesize;
  int? _pages;
  int? _page;
  List<Items>? _items;

  int? get counts => _counts;
  int? get pagesize => _pagesize;
  int? get pages => _pages;
  int? get page => _page;
  List<Items>? get items => _items;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['counts'] = _counts;
    map['pagesize'] = _pagesize;
    map['pages'] = _pages;
    map['page'] = _page;
    if (_items != null) {
      map['items'] = _items?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

